import Home from './Pages/Home'
import Nav from './Components/Nav';
import './App.css';
import { Routes, Route } from "react-router-dom";
import Card from './Components/Card';
function App() {
  return (
    <div>
      <Routes>
     <Nav/>
      <Route path="/" element={<Home/>} />
      <Route path="/card" element={<Card/>} />
      </Routes>

    </div>
  );
}

export default App;
